    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        arguments?.let {
            param1 = it.getString(ARG_PARAM1)
            param2 = it.getString(ARG_PARAM2)
        }
    }

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        _binding = FragmentCBinding.inflate(inflater, container, false)
        val view = binding.root

        val categoryListView: ListView = view.findViewById(R.id.categoryListView)
        val adapter = ArrayAdapter(requireContext(), android.R.layout.simple_list_item_1, categoryList.map { it.name })
        categoryListView.adapter = adapter

        categoryListView.setOnItemClickListener { _, _, position, _ ->
            val selectedCategory = categoryList[position]
            Toast.makeText(requireContext(), "선택한 카테고리: ${selectedCategory.name}", Toast.LENGTH_SHORT).show()

            // 선택한 카테고리의 하위 카테고리를 보여줍니다.
            showSubCategories(selectedCategory.subCategories)
        }

        return view
    }

    private fun showSubCategories(subCategories: List<CategoryItem>) {
        val subCategoriesDialog = AlertDialog.Builder(requireContext())
            .setTitle("아이템 선택")
            .setItems(subCategories.map { it.name }.toTypedArray()) { _, subCategoryPosition ->
                val selectedSubCategory = subCategories[subCategoryPosition]
                Toast.makeText(requireContext(), "선택한 하위 카테고리: ${selectedSubCategory.name}", Toast.LENGTH_SHORT).show()

                // 여기에 선택한 하위 카테고리에 따라 다른 동작을 수행할 수 있습니다.
                // 예를 들어, 선택된 하위 카테고리에 따라 또 다른 하위 카테고리를 보여줄 수 있습니다.
                // 선택한 하위 카테고리의 하위 카테고리가 있다면 다시 showSubCategories 호출
                if (selectedSubCategory.subCategories.isNotEmpty()) {
                    showSubCategories(selectedSubCategory.subCategories)
                } else {
                    // 하위 카테고리가 더 이상 없으면 WebScrapingActivity로 이동
                    navigateToWebScrapingActivity(selectedSubCategory)
                }

            }
            .setPositiveButton("확인") { dialog, _ ->
                dialog.dismiss()
            }
            .create()

        subCategoriesDialog.show()
    }

    private fun navigateToWebScrapingActivity(category: CategoryItem) {
        val intent = Intent(requireContext(), WebScrapingActivity::class.java)

        // 선택한 카테고리 정보를 인텐트에 추가하여 웹 스크래핑 액티비티로 전달
        intent.putExtra("selectedCategory", category)

        startActivity(intent)
    }

    companion object {
        @JvmStatic
        fun newInstance(param1: String, param2: String) =
            FragmentC().apply {
                arguments = Bundle().apply {
                    putString(ARG_PARAM1, param1)
                    putString(ARG_PARAM2, param2)
                }
            }
    }

    override fun onDestroyView() {
        super.onDestroyView()
        _binding = null
    }
}

